        private void btn_p_copy_Click(object sender, System.EventArgs e)
        {
           
            // Select all text in the text box.
           
            rchtxbx_word.Focus();
            rchtxbx_word.Select(0, rchtxbx_word.Text.Length);

            // Determine if any text is selected in the TextBox control.
            if (rchtxbx_word.SelectionLength > 0)
            {
                // Copy the contents of the control to the Clipboard.
                rchtxbx_word.Copy();
